import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';

const PetDetails = () => {
  const location = useLocation();
  const petData = location.state && location.state.petData;

  if (!petData) {
    return <p>Error: Pet not found</p>;
  }

  return (
    <div>
      <h2>{petData.name}</h2>
      <p>Age: {petData.age}</p>
      <p>Gender: {petData.gender}</p>
      <p>Size: {petData.size}</p>
      <p>Primary Breed: {petData.breeds.primary}</p>
      <p>Secondary Breed: {petData.breeds.secondary}</p>
      <p>Mixed: {petData.breeds.mixed ? 'Yes' : 'No'}</p>
      <p>Spayed/Neutered: {petData.attributes.spayed_neutered ? 'Yes' : 'No'}</p>
      <p>House Trained: {petData.attributes.house_trained ? 'Yes' : 'No'}</p>
      <p>Special Needs: {petData.attributes.special_needs ? 'Yes' : 'No'}</p>
      <p>Shots Current: {petData.attributes.shots_current ? 'Yes' : 'No'}</p>
      <p>Email: {petData.contact.email}</p>
      <p>Phone: {petData.contact.phone}</p>
      <p>Location: {petData.contact.address.city}, {petData.contact.address.state}</p>
      <p>Address: {petData.contact.address.address1}</p>
      <div>
        <p>Photos:</p>
        {petData.photos && petData.photos.map((photo, index) => (
          <img key={index} src={photo.medium} alt={`Photo ${index + 1}`} />
        ))}
      </div>
      <p>
        <a href={petData.url} target="_blank" rel="noopener noreferrer">
          View on Petfinder
        </a>
      </p>
    </div>
  );
};

export default PetDetails;
